import React, { useState } from "react";
import "./Invit2.css"

const Invitacion3 = () => {
    const [sobreAbierto, setSobreAbierto] = useState(false);

    return (
        <>
            {!sobreAbierto ? (
                <div className="sobre" id="sobre">
                    <div className="first" id="sobre_hoja1"></div>
                    <button className="sello" id="sello" onClick={() => setSobreAbierto(true)}>
                        Abrir Invitación
                    </button>
                    <div className="second" id="sobre_hoja2"></div>
                </div>
            ) : (
                <div className="contenido">
                    {/* Aquí puedes agregar contenido adicional si lo necesitas */}
                </div>
            )}
            <div id="sobreParams" data-translatey="12%" data-duration="3.5"></div>
        </>
    );
};

export default Invitacion3;
